import React from "react";
import Wrapper from "./components/Wrapper";
import Title from "./components/Title";
import SpongeBobCard from "./components/SpongeBobCard";
import SquidwardCard from "./components/SquidwardCard";
import MrKrabsCard from "./components/MrKrabsCard";
import friends from "./friends.json";
import Friendcard from "./components/Friendcard";



function App() {
  return (
    <Wrapper>
      <Title>friends list bro</Title>

      <Friendcard name={friends[0].name} cook={friends[0].occupation} image={friends[0].image}/>
      <Friendcard name={friends[1].name} cook={friends[1].occupation} image={friends[1].image}/>
      <Friendcard name={friends[2].name} cook={friends[2].occupation} image={friends[2].image}/>


    </Wrapper>
  );
}




export default App;
